import { useState } from 'react';

function Home() {
    return <div color="Fffff">
        <h1>Home Page</h1>
        <Contador />
    </div>
}

function Contador(){
    const [contador,setContador] = useState(1); 

    function adicionarContador(){
        setContador(contador + 1);
    }
    return(
        <div>
            <div>{contador}</div>
            <button onClick={adicionarContador}>Adicionar nun</button>
        </div>
    )
}

export default Home
